@Gh0stNet

1) Why did you leave the files in RAR format?  I appreciate the upload, but would it really have taken that much time to extract them before creating a torrent?  People are less likely to seed after they are done downloading!  Because I sure as hell am not keeping both the compressed RARs and the extracted files taking up space on my HD.  

2) Why did you link two different cracks in the comments?  What is the difference between FLT's "PROPER" crack and RELOADED's "Real Proper" crack?  Which one should we use?
